  const [file,setFile]=useState("");

  function handleChange(e){
    console.log(e.target.files);
    setFile(URL.createObjectURL(e.target.files[0]));
  }


  return (
    <div className="App">
      <>
      <Header/>
      <Navbar/>
     <h1>React App</h1>

        <button onChange={handleChange}>Upload an Image</button>

     <Footer/>
     </>
    </div>
  );
}

export default App;
